import {Link} from "react-router-dom";

const ShoesCard = ({shoe}) => {
    console.log(shoe)
    return (
        <li key={shoe.id}>
            <Link to="">
                <img src={`../utils/img/${shoe.url_path}`} alt="Shoes photo"></img>
            </Link>
            <div>{shoe.brand}</div>
            {shoe.brand} <br/>
            {shoe.model} <br/>
            {shoe.price} <br/>
            {shoe.ratin}
        </li>
    )
}


export default ShoesCard;
